const api = "https://rebooze.herokuapp.com"

var obj = {
    mode: 'cors',
    headers: {
      'Content-Type': 'application/json'
    }
  }

export const getBeers = () =>
    fetch(`${api}/beers`, obj)
    .then(res => res.json())
